import React from 'react';

const Index = () => {
  return (
    <div>
      <h1>Bem-vindo ao MyDailyStatus!</h1>
      <a href='/api/login'
        className='py-4 px-2 rounded bg-pink-800 font-bold shadow-xl hover:shadow block w-1/4 text-center mx-auto text-white'>
        Comece por aqui
      </a>
    </div>
    )};

export default Index;
